import './category.css';
const Category=()=>{
    return(
        <div className='catcontainer'>
            <h1>Fast food</h1>
           <div className="catimage">
            <img src="/assets/carpizza.png" alt="imagename"/>
           </div>
        </div>
    )
}
export default Category;
